import React, { useState, useEffect, useContext } from 'react'; // Import useState and useEffect
import { Form, Button, Container, Row, Col, Card } from 'react-bootstrap';
import Swal from 'sweetalert2';
import UserContext from '../UserContext';  // Import UserContext

export default function Profile() {
    const { user } = useContext(UserContext);  // Access user from context
    const [password, setPassword] = useState(''); // Initialize state for password
    const [confirmPassword, setConfirmPassword] = useState(''); // Initialize state for confirmPassword
    const [email, setEmail] = useState(user.email || '');  // Use user.email from context

    // Log user to ensure the data is being passed correctly
    useEffect(() => {
        console.log(user);  // Check if user contains firstName, lastName, email, contactNumber
    }, [user]);

    const updatePassword = (e) => {
        e.preventDefault();

        if (password !== confirmPassword) {
            Swal.fire({
                title: 'Error',
                text: 'Passwords do not match',
                icon: 'error',
            });
            return;
        }

        fetch(`http://localhost:4000/users/update/${user.id}`, {
            method: 'PUT',
            headers: {
                'Content-Type': 'application/json',
                Authorization: `Bearer ${localStorage.getItem('token')}`,
            },
            body: JSON.stringify({ newPassword: password }),
        })
            .then((response) => response.json())
            .then((data) => {
                if (data.code === 'USER-PASSWORD-SUCCESSFULLY-UPDATED') {
                    Swal.fire({
                        title: 'Success',
                        text: data.message,
                        icon: 'success',
                    });
                    setPassword('');
                    setConfirmPassword('');
                } else {
                    Swal.fire({
                        title: 'Error',
                        text: data.message,
                        icon: 'error',
                    });
                }
            })
            .catch((err) => {
                Swal.fire({
                    title: 'Error',
                    text: 'Something went wrong while updating the password',
                    icon: 'error',
                });
            });
    };

    const updateEmail = (e) => {
        e.preventDefault();

        fetch(`http://localhost:4000/users/updateEmail/${user.id}`, {
            method: 'PUT',
            headers: {
                'Content-Type': 'application/json',
                Authorization: `Bearer ${localStorage.getItem('token')}`,
            },
            body: JSON.stringify({ newEmail: email }),
        })
            .then((response) => response.json())
            .then((data) => {
                if (data.code === 'USER-EMAIL-SUCCESSFULLY-UPDATED') {
                    Swal.fire({
                        title: 'Success',
                        text: data.message,
                        icon: 'success',
                    });
                } else {
                    Swal.fire({
                        title: 'Error',
                        text: data.message,
                        icon: 'error',
                    });
                }
            })
            .catch((err) => {
                Swal.fire({
                    title: 'Error',
                    text: 'Something went wrong while updating the email',
                    icon: 'error',
                });
            });
    };

    if (!user || !user.firstName) {
        return (
            <Container>
                <Row className="justify-content-center">
                    <Col md={6}>
                        <h2 className="mt-5 mb-4 text-center">Profile</h2>
                        <p>Loading user data...</p>
                    </Col>
                </Row>
            </Container>
        );
    }

    return (
        <Container fluid className="bg-light py-5">
            <Row className="justify-content-center">
                <Col md={8}>
                    <Card className="shadow-lg rounded-lg overflow-hidden">
                        <Card.Body>
                            <div className="text-center mb-4">
                                <img
                                    src={user.profilePicture || 'https://img.freepik.com/premium-vector/spiderman-character-vector-illustration-cartoon_969863-361231.jpg'}
                                    alt="Profile"
                                    className="rounded-circle border border-4 border-primary shadow-sm hover-shadow"
                                    width="150"
                                    height="150"
                                />
                            </div>

                            <h2 className="text-center text-primary mb-3">
                                Welcome, {user.firstName} {user.lastName}!
                            </h2>
                            <p className="text-center text-muted mb-3">Email: {user.email}</p>
                            <p className="text-center text-muted mb-3">
                                Contact Number: {user.contactNumber || 'Not Provided'}
                            </p>

                            {/* Form elements for updating email and password */}
                        </Card.Body>
                    </Card>
                </Col>
            </Row>
        </Container>
    );
}
